import React,{useEffect} from 'react';
import './App.css';
import Header from './Header.js'
import Home from './Home.js'
import {BrowserRouter as Router,Switch,Route} from
'react-router-dom';
import Checkout from './Checkout.js'
import Login from './Login.js'

function App() {

  useEffect(() => {
    return () => {

    };
  }, [])

  return (
  	<Router>
    <div className="App">

      <Switch>

      <Route path="/login">

        <Login/>
        </Route>
      	<Route path="/checkout">

     		<Checkout/>
      	</Route>
      	<Route path="/">
      		<Header/>
     		<Home />
      	</Route>

      </Switch>

    </div>
    </Router>
  );
}

export default App;
